import React from 'react';
import styles from './styles/sroductSnippet.module.scss';

const ProductSnippet = () => {
    return (
        <div className={styles.block}>
            <div className="">
                <img src='' alt="" />
                <div className="">
                    <h2 className={styles.productTtl}></h2>
                    <div className={styles.counter}>
                        <button className={styles.minus}>–</button>
                        <div className={styles.count}>{}</div>
                        <button className={styles.plus}>+</button>
                    </div>
                </div>
            </div>

            <div className={styles.costBlokc}>
                <h2 className={styles.cost}></h2>
                <h2 className={styles.remove}></h2>
            </div>
        </div>
    );
};

export default ProductSnippet;
